import * as types from "../constants/ActionTypes";


function setUserList(state, payload) {
    return payload
}

const Chat = (state = initialState, action) => {
    switch (action.type) {
        case types.USER_CHAT_LIST :
            return setUserList(state,action.payload);
        default:
            return state;
    }
}
export default Chat;
